import { View, Image } from 'react-native';
import { IconProps } from './Icon.types';

export function AirDOGEIcon({ scale = 1 }: IconProps) {
  const width = 32;
  const height = 32;

  const base64Path =
    'data:image/png;base64,';

  return (
    <View
      style={{
        width: width * scale,
        height: height * scale,
        borderRadius: width,
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
      <Image
        style={{ width: width * scale, height: height * scale }}
        source={{
          uri: base64Path
        }}
      />
    </View>
  );
}
